(function () {
	
	/***
	 * STYLES
	 */
	 var parentApp= window.top.location.host;
	
	  var scripts = document.getElementsByTagName('script');
      var lastScript = scripts[scripts.length-1];
      var scriptName = lastScript;
      var data_config_key=scriptName.getAttribute('data-config-key');


     var data_heading=scriptName.getAttribute('data-heading');
      var data_welcomeText=scriptName.getAttribute('data-welcomeText');
      

	//console.log("chat float--------"+config.key);
	
	
	var global_app_img = "";
	var global_attachment_img_active = "data:image/png;base64,";
	var global_attachment_img_inactive = "data:image/png;base64,";
	var global_camera_active = "data:image/png;base64,";
	var global_camera_inactive = "data:image/png;base64,";
	var global_chatbot_reply = "data:image/png;base64,";
	var global_user_img = "data:image/png;base64,";
	var global_chatbot_header = "data:image/png;base64,";
	var global_cancel_img = "data:image/png;base64,";
	var global_ping_img = "data:image/png;base64,";
	var global_smile_active = "data:image/png;base64,";
	var global_smile_inactive = "data:image/png;base64,";
	var global_app_img = "data:image/gif;base64,";
	//var chatApp="http://flaowcrvq01:8001/chatBot?key="+data_config_key+"&app="+parentApp;
	var chatApp="http://44.239.217.170:8080/chatBotTcsAndroid3New/?key="+data_config_key+"&app="+parentApp;

	//http://localhost:8080/chatBot/
	
	
	
	/****** CHAT FLAOT BUTTON STARTS*****/
	var chatIContainerWrapper = __createElement("div", "chatWrapper_container_chat_bot_wrapper","chatWrapper_container_chat_bot_wrapper");
	var cancelButton = __createElement("button", "chatWrapper_container_chat_bot_cancelButton", "chatWrapper_container_chat_bot_cancelButton");
	var cancelButtonImg = document.createElement("img");
	cancelButtonImg.setAttribute('src', global_cancel_img);
	cancelButtonImg.setAttribute('alt', 'na');

			
	var floatbtnWrapper = __createElement("div", "chatFloatBtn", null);
	var floatButton = __createElement("button", "floatButton", "floatButton");
	var floatButton_oImg = document.createElement("img");
	floatButton_oImg.setAttribute('src', global_app_img);
	floatButton_oImg.setAttribute('alt', 'na');
	__appendToNode(floatButton_oImg, floatButton)
	__appendToNode(floatButton, floatbtnWrapper);
	
	
	__appendToNode(floatbtnWrapper, chatIContainerWrapper);
	__appendToNode(cancelButtonImg, cancelButton);
	__appendToNode(cancelButton, chatIContainerWrapper);
	document.body.appendChild(chatIContainerWrapper);
	
	/*******CHAT WINDOW STARTS ****/
	
	
	var chatIframeWrapper = __createElement("iframe", "chatWrapper_container_chat_bot",
	"chatWrapper_container_chat_bot");
	chatIframeWrapper.setAttribute('src', chatApp);
	
	
	//CANECL BUTTON
	
	
	
	
	
	
	
	document.body.appendChild(chatIframeWrapper);
	/*******CHAT WINDOW ENDS ****/
	
	
	
	
	
	
	/*********************ACTION STARTS*************/
	
	document.getElementById("floatButton").onclick = function () {
		shoHideChatWindow('SHOW')
	};
	document.getElementById("chatWrapper_container_chat_bot_cancelButton").onclick = function () {
		shoHideChatWindow('HIDE')
	};
	
	
	
	
	/********************ACTION ENDS*****************/
	
	
	
	
	
	
	
	
	
	
	
	/*******************************UTLITY FUNCTION STARTS**************************** */

	/**
	 * function create DOM
	 */
	function __createElement(element, cls, id) {
		var elem = document.createElement(element);
		if (null != cls) {
			elem.className = cls;
		}
		if (null != id) {
			elem.id = id;
		}

		return elem;

	}

	/**
	 * function to append DOM
	 */
	function __appendToNode(elem, pNode) {
		return pNode.appendChild(elem)
	}
	
	function shoHideChatWindow(action) {
		var cancelButton = document
		.getElementById("chatWrapper_container_chat_bot_cancelButton");
		var elem = document
		.getElementById("chatWrapper_container_chat_bot");
		if (action == 'SHOW') {
			
			elem.classList.add("show");
			cancelButton.classList.add("show");
			
			if(elem && elem.contentDocument) {
			if (elem.contentDocument.getElementById('chatHeader_text_con')) {
				elem.contentDocument.getElementById('chatHeader_text_con').innerHTML = data_heading;
			}
			
			if (elem.contentDocument.getElementById('welcomeText')) {
				elem.contentDocument.getElementById('welcomeText').innerHTML = data_welcomeText;
			}
			
			elem.contentDocument.getElementById("red").onclick = function () {
				elem.contentDocument.body.className = 'theme-red';
			};
			
			elem.contentDocument.getElementById("blue").onclick = function () {
				elem.contentDocument.body.className = 'theme-blue';
			};
				
			elem.contentDocument.getElementById("green").onclick = function () {
				elem.contentDocument.body.className = 'theme-green';
			};
			
			elem.contentDocument.getElementById("yellow").onclick = function () {
				elem.contentDocument.body.className = 'theme-yellow';
			};
			
			elem.contentDocument.getElementById("black").onclick = function () {
				elem.contentDocument.body.className = '';
			};
			}
		} else {
			var elem = document
				.getElementById("chatWrapper_container_chat_bot");
			elem.classList.remove("show");
			cancelButton.classList.remove("show");
		}
	}
	/** *****************************UTLITY FUNCTION ENDS**************************** */

	
	
	

})();
